(12240, 'Dairy Queen #18527, 5000 Kitsap Way, Bremerton, WA', '5000 Kitsap Way, Bremerton, WA Very disappointing experience. I ordered a grilled chicken salad to go, with honey mustard dressing. I took the bag back to my hotel room, and found that no honey mustard dressing was in the bag, even though my receipt clearly showed "honey mustard." I phoned to report this to the manager, and first tried to convince me that I had failed to specify the dressing. When I explained that it was printed right on my receipt, she said, "that happens sometime!" When I asked her if she was willing to make it right, she said if I drove back to the restaurant, she would give me a packet of honey mustard dressing. When I asked if she would give me anything else for my troubles and for the inconvenience, she replied "NO!" The salad was very mediocre--all iceberg lettuce with no other tomatoes or carrots, and only about five tiny squares of chicken. I have learned a lesson about not going to Dairy Queen for a meal--maybe a shake or a blizzard, but their food is very sub-standard. Service was poor. My phone conversation with the manager was very frustrating and disappointing.', '360-373-5845', 'Bremerton', 'WA', 'United States', '', '73 of 164', '1', '- 13 Oct 2013', 47.5696, -122.683, 'tripadvisor'),
